import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";


const Navbar = () => {
    return (
        <>
            <BrowserRouter>
                <Routes>
                    <Route />
                    <Route />
                    <Route />
                    <Route />
                </Routes>
            </BrowserRouter>
        </>
    )
}

export default Navbar;
